import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { handleError, handleSuccess } from '../../../../utils/utils';
import { ToastContainer } from 'react-toastify';
import styles from './PendingOrders.module.css';
import Navbar from '../../../../components/navbar/Navbar';
import Footer from '../../../../components/footer/Footer';

function PendingOrders() {
    const [dataCementOrder, setDataCementOrder] = useState([]);

    const navigate = useNavigate();

    const handleLogout = (e) => {
        localStorage.removeItem('token');
        localStorage.removeItem('role');
        handleSuccess('User Loggedout');
        setTimeout(() => {
            navigate('/company-login');
        }, 1000)
    }

    useEffect(() => {
        const fetchDataCementOrder = async () => {
            try {
                const url = `http://localhost:8080/auth/company/data-cement-order`;
                const headers = {
                    headers: {
                        'Authorization': localStorage.getItem('token'),
                    }
                }
                const response = await fetch(url, headers);
                const result = await response.json();
                setDataCementOrder(result);
            } catch (err) {
                handleError(err);
            }
        }
        fetchDataCementOrder();
    }, []);

    return(
        <section className={styles.PendingOrdersBody}>
            <Navbar 
                one="Home"
                pathOne="/company/home"
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/company/home/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/company/home/pending-orders"
                two3="Old orders"
                pathTwo3="/company/home/old-orders"
                three="Cement"
                pathThree="/company/home/cement-order"
                four="Concrete"
                pathFour="/company/home/concrete-order"
                five="Profile"
                pathFive="/company/home/profile"
                logout={handleLogout}
            />

            
            <div className={styles.pendingOrdersTitle}>
                <h2 className={styles.pendingOrdersH2}>Cement Orders</h2>
            </div>
            <div className={styles.pendingOrdersContainer}>
                {(() => {
                    const pendingOrders = dataCementOrder.filter(order => order.status === "pending"); // Filter once
                    return pendingOrders.length > 0 ? (
                        pendingOrders.map((order, index) => (
                            <div className={styles.pendingOrdersRow} key={order._id}> {/* Use a unique key like order._id */}
                                <p><strong>Supplier name:</strong> {order.supplierName} </p>
                                <p><strong>Company name:</strong> {order.companyName} </p>
                                <p><strong>Company phone:</strong> {order.companyPhone} </p>
                                <p><strong>Recipient's name:</strong> {order.recipientName} </p>
                                <p><strong></strong>Recipient's phone: {order.recipientPhone} </p>
                                <p><strong></strong>Location: {order.location} </p>
                                <p><strong></strong>Delivery time: {order.deliveryTime} </p>
                                <p><strong></strong>Cement quantity: {order.cementQuantity} </p>
                                <p><strong></strong>Number of cement bags: {order.cementNumberBags} </p>
                                <p><strong></strong>Cement price: {order.cementPrice} </p>
                            </div>
                        ))
                    ) : (
                        <p pendingOrdersP>No pending orders found.</p>
                    );
                })()}
            </div>

            <Footer 
                one="Home"
                pathOne="/company/home"
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/company/home/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/company/home/pending-orders"
                two3="Old orders"
                pathTwo3="/company/home/old-orders"
                three="Cement"
                pathThree="/company/home/cement-order"
                four="Concrete"
                pathFour="/company/home/concrete-order"
                five="Profile"
                pathFive="/company/home/profile"
                logout={handleLogout}
            />
            <ToastContainer />
        </section>
    );
}
export default PendingOrders;
